    public function sendResumeAction($resume_id = 0, $vacance_id = 0 , Request $request = null)
    {
        if($resume_id != 0 and $vacance_id != 0)
        {
            $resume = $this->getDoctrine()->getRepository("TorgovorotTorgBundle:AdsResume")->find($resume_id);
            
            $vacance = $this->getDoctrine()->getRepository("TorgovorotTorgBundle:AdsVacance")->find($vacance_id);
            
            $repository = $this->getDoctrine()->getManager()->createQuery(
                    "SELECT p
                    FROM TorgovorotTorgBundle:VacanceApplications p
                    where p.resumeId = $resume_id"
                    . " and p.vacanceId = $vacance_id"
                );
            $application = $repository->getResult();
            
            if($application == null)
            {
                $em = $this->getDoctrine()->getManager();
                
                $app = new VacanceApplications();
                $app->setResumeId($resume_id);
                $app->setVacanceId($vacance_id);
                $app->setTime(new \DateTime());
                
                $em->persist($app);
                $em->flush();
                
                return $this->redirect($this->generateUrl("send_resume_part3", array("vacance_id" => $vacance_id, "resume_id" => $request->get("resume_id"), "condition" => "finish")));
            }
            else if($application != null)
            {
                return $this->redirect($this->generateUrl("send_resume_part3", array("vacance_id" => $vacance_id, "resume_id" => $request->get("resume_id"), "condition" => "exist")));
            }
        }
    }
    
    public function selectResumeAction($vacance_id = 0, Request $request = null)
    {
        $user = new Users();
        
        $user = $this->get('security.context')->getToken()->getUser();
        
        $items = $this->getDoctrine()->getRepository("TorgovorotTorgBundle:AdsResume")->findBy(array('ownerId' => $user->getId()));
        
        $vacance = $this->getDoctrine()->getRepository("TorgovorotTorgBundle:AdsVacance")->find($vacance_id);
        
        if($request->get("resume_id") and $request->get("vacance_id") and !$request->get("confirm") and !empty($items))
        {
            
            $resume = $this->getDoctrine()->getRepository("TorgovorotTorgBundle:AdsResume")->find($request->get("resume_id"));
            
            $vacance = $this->getDoctrine()->getRepository("TorgovorotTorgBundle:AdsVacance")->find($request->get("vacance_id"));
            
            return $this->render('TorgovorotTorgBundle:Default:send_resume.html.twig', array(
            'resume' => $resume ,
            'vacance' => $vacance ,
            'user' => $user,
            'vac_id' => $vacance_id,
            'action' => 'resumes_prepair',
            'vacance' => $vacance
            ));
        }
        elseif($request->get("resume_id") and $request->get("vacance_id") and $request->get("confirm"))
        {
            
            return $this->redirect($this->generateUrl("send_resume_part2", array("vacance_id" => $vacance_id, "resume_id" => $request->get("resume_id"))));
        }
        else
        {
            if(empty($items))
            {
                return $this->finishResumeAction(0, 0, "no_resumes");
            }
        }
        
        return $this->render('TorgovorotTorgBundle:Default:send_resume.html.twig', array(
            'items' => $items ,
            'user' => $user,
            'vac_id' => $vacance_id,
            'action' => 'resumes_list',
            'vacance' => $vacance
        ));
    }
    
    public function finishResumeAction($resume_id = 0, $vacance_id = 0 ,$condition = "finish", Request $request = null)
    {
        $user = new Users();
        
        $user = $this->get('security.context')->getToken()->getUser();
        
        $vacance = $this->getDoctrine()->getRepository("TorgovorotTorgBundle:AdsVacance")->find($vacance_id);
        
        return $this->render('TorgovorotTorgBundle:Default:send_resume.html.twig', array(
            'user' => $user,
            'vac_id' => $vacance_id,
            'action' => 'finish_resume',
            'vacance' => $vacance,
            'message' => $condition
        ));
    }
    
