    public function setComplaintsAction($item_id, $ads_type)
    {
        $compl = new Complaints();
        
        $ip = $_SERVER['REMOTE_ADDR'];
        
        $compl->setItemId($item_id)
              ->setAdsType($ads_type)
              ->setTime(new \DateTime("now"))
              ->setIp($ip);
        
      $this->getDoctrine()->getManager()->persist($compl);
      $this->getDoctrine()->getManager()->flush();
      $response = array("code" => 100, "success" => true);
      
        //you can return result as JSON
      return new Response(json_encode($response)); 
    }
    
    public function updateAdsAction(Request $request = null)
    {
        $item_id = $request->get('item_id');
        $ads_type = $request->get('ads_type');
        $action = $request->get('action');
        
        $em = $this->getDoctrine()->getManager();
        
        $ads = "";
        
        $response = array("code" => 100, "success" => false);
        
        switch ($ads_type) 
        {
                case 1:
                    $ads = "AdsRealty";
                    break;
                case 2:
                    $ads = "AdsVacance";
                    break;
                case 3:
                    $ads = "AdsResume";
                    break;
                case 4:
                    $ads = "AdsGoods";
                    break;
                case 5:
                    $ads = "AdsEvents";
                    break;
                /*case 6:
                    $ads = "Users";
                    break;*/
                case 8:
                    $ads = "AdsCars";
                    break;
         }
         
         if($ads != "")
         {
             $search_arr = array(
                 'id' => $item_id
             );
             $object = $em->getRepository("TorgovorotTorgBundle:$ads")->findOneBy($search_arr);
             
             if($object != null)
             {
                 $object->setAdsState($action);
                 $em->persist($object);
                 $em->flush();
                 $response = array("code" => 100, "success" => true);
             }
             
         }
         
         
        //you can return result as JSON
        return new Response(json_encode($response));
    }
    
