    public function repairGoodsAction()
    {
        $object = new AdsGoods();
        
        $entities = $this->getDoctrine()->getRepository("TorgovorotTorgBundle:AdsGoods")->findAll();
        
        foreach($entities as $entity)
        {
            $object = $entity;
            
            $name = $object->getTitle();
            
            $name = html_entity_decode($name);
            
            //echo $name."<br>";
            
            $descr = $object->getText();
            
            $new_descr_arr = explode(" ", $descr);
            
            $short = "";
            //echo "<pre>";
            //print_r($new_descr_arr);
            //echo "</pre>";
            foreach($new_descr_arr as $key=>$dc)
            {
                if($key < 8)
                    $short .= "$dc ";
                elseif($key == 8)
                {
                    $short .= "...";
                    break;
                }
            }
            $object->setShortDesc($short);
            $object->setTitle($name);
            
            $this->getDoctrine()->getManager()->persist($object);
            $this->getDoctrine()->getManager()->flush();
        }
        return new Response();   
    }
    
    public function repairCatsAction()
    {
        $em = $this->getDoctrine()->getManager();
        
        $all_cats = $em->getRepository("TorgovorotTorgBundle:Cats")->findAll();
        
        foreach($all_cats as $key=>$cat)
        {
            if($cat->getType() == '3')
            {
                unset($all_cats[$key]);
            }
        }
        
        foreach($all_cats as $key=>$cat)
        {
            $bind = new CatBind();
            $bind->setMainId(2);
            $bind->setPodId($cat->getId());
            $em->persist($bind);
            $em->flush();
        }
        
        foreach($all_cats as $key=>$cat)
        {
            $bind = new CatBind();
            $bind->setMainId(3);
            $bind->setPodId($cat->getId());
            $em->persist($bind);
            $em->flush();
        }
    }
    
