    public function saveAllDiscountsAction()
    {
        echo "<pre>";
        $em = $this->getDoctrine()->getManager();
        
        $data = "";
        $data = base64_decode($data);
        
        $data = unserialize($data);
        
        foreach($data as $discount)
        {
            $user = new Users();
            
            $new_user = $discount['user'];
            
            $check = $em->getRepository("TorgovorotTorgBundle:Users")->findOneBy(array('companyName' => $new_user['company']));
            
            if($check != null)
            {
                $user = $check;
            }
            else
            {
                $user->setEmail($new_user['email']);
                $user->setCompanyName($new_user['company']);
                $user->setFio($new_user['fio']);
                $mobile = explode(",", $new_user['mobile']);
                $user->setMobile($mobile[0]);
                $em->persist($user);
                $em->flush();
            }
            
            $addr = new Address();
            
            $new_addr = $discount['addr'];
            
            $check_addr = $em->getRepository("TorgovorotTorgBundle:Address")->findOneBy(array('street'=> $new_addr['street']));
            
            if($check_addr != null)
            {
                $addr = $check_addr;
            }
            else
            {
                $addr->setStreet($new_addr['street']);
                $addr->setCity("Рыбинск");
                $addr->setHouse($new_addr['number']);
                $em->persist($addr);
                $em->flush();
            }
            
            $disc = new AdsDiscounts();
            
            $new_disc = $em->getRepository("TorgovorotTorgBundle:AdsDiscounts")->findOneBy(array('title' => $discount['title']));
            
            if($new_disc != null)
            {
                $disc = $new_disc;
            }
            else
            {
                $disc->setAddrId($addr->getId());
                $disc->setAdsState(1);
                $disc->setDescription($discount['descr']);
                $disc->setOwnerId($user->getId());
                $disc->setShortDesc($discount['short']);
                $disc->setTime(new \DateTime("now"));
                $disc->setTitle($discount['title']);                
            }
            if($disc->getPhotoIds() == "")
            {
                
                $new_doc = new \Torgovorot\TorgBundle\Helper\Uploader\Document(null,0, $em);
                $id = $new_doc->download($discount['image']);
                //echo $id;
                $disc->setPhotoIds($id);
            }
            else
            {
                $ids = $disc->getPhotoIds();
                $new_doc = new \Torgovorot\TorgBundle\Helper\Uploader\Document(null,0, $em);
                $id = $new_doc->download($discount['image']);
                $disc->setPhotoIds($ids.";".$id);
            }

            print_r($disc);
            //$em->persist($disc);
            //$em->flush();
        }
        
        //print_r($data);
        echo "</pre>";
    }
    
